import React from "react";

function Homepage() {
    return (
        <div className="p-6 text-center">
            <h1 className="text-3xl font-bold">Welcome to Document Manager</h1>
            <p className="mt-2 text-gray-600">Manage and store your documents securely.</p>
        </div>
    );
}

export default Homepage;
